import React from 'react'
import './Tabing.css';

const Tabing = () => {
  return (
    <div className='tabsOuter'>
      <h1>Law Prep Vision Mission and Values</h1>
      <ul>
        <li><button>Vision</button></li>
        <li><button>Mision</button></li>
        <li><button>Values</button></li>
      </ul>
    </div>
  )
}

export default Tabing;
